import * as React from 'react';
import { useContext } from 'react'
import { styled, alpha } from '@mui/material/styles';
import { animate, glide } from "motion"
import Divider from '@mui/material/Divider';
import Box from '@mui/material/Box';
import Paper from '@mui/material/Paper';
import Toolbar from '@mui/material/Toolbar';
import IconButton from '@mui/material/IconButton';
import Typography from '@mui/material/Typography';
import InputBase from '@mui/material/InputBase';
import Badge from '@mui/material/Badge';
import MenuItem from '@mui/material/MenuItem';
import Menu from '@mui/material/Menu';
import MenuIcon from '@mui/icons-material/Menu';
import SearchIcon from '@mui/icons-material/Search';
import AccountCircle from '@mui/icons-material/AccountCircle';
import MoreIcon from '@mui/icons-material/MoreVert';
import ShoppingCartIcon from '@mui/icons-material/ShoppingCart';
import LoginIcon from '@mui/icons-material/Login';
import Drawer from '@mui/material/Drawer';
import Button from '@mui/material/Button';
import List from '@mui/material/List';

import ListItem from '@mui/material/ListItem';
import ListItemButton from '@mui/material/ListItemButton';
import ListItemIcon from '@mui/material/ListItemIcon';
import ListItemText from '@mui/material/ListItemText';
import { TimeToLeave } from '@mui/icons-material';
import tile from '../images/jewelery1.jpg'


function LandingPage() {
  return (
    <Box className="carousel" sx={{display:"flex", flexDirection:"column"}}>
      <Box sx={{display: 'flex', width: "60vw", justifyContent: 'space-evenly', mx: "auto"}}>  
          <Box>
            <Typography>Men</Typography>
          </Box>
          <Box>
            <Typography>Women</Typography>
          </Box>
          <Box>
            <Typography>Jewelry</Typography>
          </Box>
          <Box>
            <Typography>Electronics</Typography>
          </Box>
      </Box>
      <Divider/>
      <Box
            component="img"
            sx={{
              width: "600px",
              height: "600px"
            }}
            alt="The house from the offer."
            src={tile}
            />

    </Box>
  )
}

export default LandingPage
